/** @format */

import React, { useEffect } from 'react';
import { Redirect, Route, Switch } from 'react-router-dom';
import { connect } from 'react-redux';

import { checkUser } from '../src/redux/user/user.action';
import {
	auth,
	createDataBaseForUser,
	createDataBase,
} from '././firabase/fireBaseUtils';
import Header from './components/header/header.component';
import HomePage from './pages/directory/HomePage.page';
import ShopPage from './pages/shopPage/shopPage';
import SignIn from './pages/signIn/signIn';
import './App.css';
import Register from './pages/register/register';
import CheckOut from './pages/checkOut/checkOut';

// import SHOP_DATA from '../src/redux/collections/shop.data.js';

const App = ({ currentUser, getCurrentUser, checkUser }) => {
	useEffect(() => {
		// createDataBase(SHOP_DATA);
		checkUser();
	}, [checkUser]);

	return (
		<>
			<Header currentUser={currentUser} />
			<Switch>
				<Route exact path='/' component={HomePage} />
				<Route path='/shop' component={ShopPage} />
				<Route
					path='/signIn'
					render={() => (currentUser ? <Redirect to='/' /> : <SignIn />)}
				/>
				<Route
					path='/register'
					render={() => (currentUser ? <Redirect to='/' /> : <Register />)}
				/>
				<Route path='/checkOut' component={CheckOut} />
			</Switch>
		</>
	);
};

const mapStateToProps = (state) => ({
	currentUser: state.user.currentUser,
});

const mapDispatchToProps = (dispatch) => ({
	checkUser: () => dispatch(checkUser()),
});

export default connect(mapStateToProps, mapDispatchToProps)(App);
